start_gcode = \n;start_gcode\n\nM605 S0 ; Enter Full Ctrl Mode\nM75 ; Start the print job timer\nG21 ; set units to millimeters\nG90 ; use absolute coordinates\nM83 ; extruder relative mode\n\n; turn off T0/T1 hot end to reduce ooze on the bed during startup. NOTE this does not explicitly wait for the hotends to totally cool down\nM104 T0 S0\nM104 T1 S0\n\nM140 S[first_layer_bed_temperature]				;turn on bed\nM190 S[first_layer_bed_temperature]				;wait for bed to get to temp\n\nG28 ; home all axes\n\nM211 X0 S0 ; Disable X Min Software Endstops\nM211 X1 S0 ; Disable X Max Software Endstops\n\n;Get hot end up to temp\nM104 T0 S{first_layer_temperature[0]}\nM104 T1 S{first_layer_temperature[1]}\nM109 T0 S{first_layer_temperature[0]}\nM109 T1 S{first_layer_temperature[1]}\n\nT0 S1 ; Switch to left extruder\nG1 Z10 ; lift\nG1 X35 Y0 F10000 ; move past bedclips\nG1 Z0.30 F1000\nG1 X265 E27 F1000 ; deposit extrusion line\nG1 Y0.6 F1000 ; move y\nG1 X35 E27 F1000 ; deposit extrusion line\nG1 Z5 F1000 ; Lift Z to avoid bedclips\n\nG1 X-53 F12000 ; Park T0\n\nT1 S1 ; Switch to right extruder\nG1 X265 Y1.3 F10000 ; move past bedclips\nG1 Z0.30 F1000\nG1 X35 E27 F1000 ; deposit extrusion line\nG1 Y1.9 F1000 ; move y\nG1 X265 E27 F1000 ; deposit extrusion line\nG1 Z5 F1000 ; Lift Z to avoid bedclips\n\nG1 X353 F12000 ; Park T1\n\nM82 ; extruder absolute mode\nG92 E0 ; zero extruder\n\n{if initial_extruder == 0} M104 T1 S{idle_temperature[1]}{endif}\n{if initial_extruder == 1} M104 T0 S{idle_temperature[0]}{endif}\n\nM400 ; wait for moves to complete\n\n;EOF_start_gcode\n
